// Initialize array for overdue IDs
let overdueIds = [];

// Loop through all items
for (let item of $items()) {
  // Check if days_overdue > 0 AND Case ID exists
  if (item.json.days_overdue > 0 && item.json['ID']) {
    overdueIds.push(item.json['ID']);
  }
}

// Return comma-separated string of IDs
return [
  {
    json: {
      overdue_case_ids: overdueIds.join(", ")
    }
  }
];

